window.bookSummaryJSON = "<i></i> <p><i>Fantasy of Freedom</i> is the final action-packed title in the Tainted Accords series. </p> <p>This is the heaviest the veil has ever felt. But I am the strongest I have ever been. The veil is nothing. </p> <p>A part of me knew when I was taken from Osolis that when I returned - if I lived long enough to return - I would carry death and destruction to her doorstep. </p> <p>That is the irony of peace. </p> <p>It comes only after war. </p> <p>Warning: cliff-hanger ending. Recommended for mature young adults. </p>"; 
